import React from 'react';
import { Avatar } from 'primereact/avatar';

const RouteCard = ({ route }) => {
    const getDifficultyClass = (difficulty) => {
        switch (difficulty?.toLowerCase()) { // Opsiyonel zincirleme eklendi
            case 'kolay': return 'bg-green-500 text-white';
            case 'orta': return 'bg-yellow-500 text-white';
            case 'zor': return 'bg-red-500 text-white';
            default: return 'bg-gray-500 text-white';
        }
    };

    return (
        <div className="bg-white rounded-2xl shadow-lg overflow-hidden transition-transform transform hover:-translate-y-1 hover:shadow-xl flex flex-col">
            <div className="relative">
                <img src={route.imageUrl} alt={route.title} className="w-full h-48 object-cover" />
                <div className="absolute inset-0 bg-black/20"></div>
                <div className="absolute top-3 left-3">
                    <span className={`px-3 py-1 text-xs font-semibold rounded-full ${getDifficultyClass(route.difficulty)}`}>
                        {route.difficulty}
                    </span>
                </div>
                {route.isPrivate && (
                    <div className="absolute top-3 right-3">
                        <span className="px-3 py-1 text-xs font-semibold rounded-full bg-white/90 text-gray-800 flex items-center backdrop-blur-sm">
                            <i className="pi pi-lock mr-1.5" style={{ fontSize: '0.7rem' }}></i>Özel
                        </span>
                    </div>
                )}
            </div>

            <div className="p-5 flex flex-col flex-grow">
                <h3 className="text-xl font-bold text-gray-800">{route.title}</h3>
                <p className="text-gray-600 text-sm mt-1 mb-4 flex-grow">{route.description}</p>
                <div className="flex items-center space-x-4 text-sm text-gray-700 mb-4">
                    <div className="flex items-center"><i className="pi pi-clock mr-1.5"></i>{route.duration}</div>
                    <div className="flex items-center"><i className="pi pi-map-marker mr-1.5"></i>{route.poiCount} POI</div>
                    <div className="flex items-center"><i className="pi pi-star-fill text-yellow-400 mr-1.5"></i>{route.rating}</div>
                </div>

                {/* HATA VEREN SATIR GÜVENLİ HALE GETİRİLDİ */}
                <div className="flex flex-wrap gap-2 mb-5">
                    {(route.tags || []).map(tag => (
                        <span key={tag} className="px-3 py-1 text-xs font-medium rounded-full bg-gray-100 text-gray-700 border border-gray-200">{tag}</span>
                    ))}
                </div>

                <div className="border-t border-gray-200 pt-4">
                    <div className="flex justify-between items-center mb-4">
                        <div className="flex items-center">
                            <Avatar image={route.author?.avatarUrl} size="normal" shape="circle" className="mr-3" />
                            <span className="text-sm font-medium text-gray-800">{route.author?.name}</span>
                        </div>
                        <button className="px-4 py-2 font-semibold text-sm rounded-lg text-white bg-green-500 hover:bg-green-600 flex items-center">
                            <i className="pi pi-eye mr-2"></i>İncele
                        </button>
                    </div>
                    <div className="flex items-center text-sm text-gray-500">
                        <i className="pi pi-heart-fill text-red-500 mr-1.5"></i>
                        <span>{route.likes}</span>
                        <span className="mx-2">•</span>
                        <span>{route.comments} yorum</span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default RouteCard;
